import React from "react";
import '../css/ListView.css'

function ListView() {
    const testArray = [{
        name: "test",
        age: "20"
    }, {
        name: "test2",
        age: "30"
    }]

    const rendering = () => {
        const result = [];
        for(let i = 0; i < testArray.length; i++) {
            result.push(<tr>
                <td>1</td>
                <td>1</td>
                <td>1</td>
                <td>1</td>
            </tr>)
        }

        return result;
    }

    function addAction() {
        testArray.push({
            name: "test3",
            age: "30"
        })
    }

    return (
        <div>
            <button onClick={addAction}>testBtn</button>
            <table className="listTBMain">
                <thead>
                <tr>
                    <th className="thCnt">idx</th>
                        <th className="thTitle">content</th>
                        <th className="thWriter">writer</th>
                        <th className="thCnt">likeCount</th>
                    </tr>
                </thead>
                <tbody>
                {rendering()}
                </tbody>
            </table>
        </div>
    )
}

export default ListView
